import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route, link } from 'react-router-dom';
import Navbar from "./components/navbar";
import Home from './views/Home'

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Navbar/>
          <Switch>
            <Route path="/">
              <Home/>
            </Route>
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
